import React from 'react';
import './country.css';
class Country extends React.Component{
    constructor(props){
        super(props);
        this.individual=props.country
    }
    render(){
        return(

            <div className="card">
                <img src={this.individual.flag} alt="Country-flag"></img>
                <h4>{this.individual.name}</h4>
        <div><p className="bold">population<span>{this.individual.population}</span></p></div>
        <div><p className="bold">Region<span>{this.individual.region}</span></p></div>
        <div><p className="bold">Capital<span>{this.individual.capital}</span></p></div>
                </div>
        )
    }
}
export default Country;
